import Link from "next/link";

const About = () => (
  <div>
    <ul>
      <li>
        <Link href="/">Home</Link>
      </li>
      <li>
        <Link href="/about">About</Link>
      </li>
    </ul>
    <h1>About BitzPrice</h1>
    <p>Aplication to view Bit coins prices</p>
  </div>
);

export default About;
